import { Container, Row } from "react-bootstrap";

const Form = (props) => {
  return (
    <div className="gray-box forms">
      <Container>
        <Row>
          <Col>
            <form></form>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Form;
